import React from "react";
import "./Setting_up.css";
import deski_blue from "../assets/deski_blue.png";
import business_team from "../assets/business_team.svg";

function Setting_up(props) {
    const { bgcolor, completed } = props;

    const containerStyles = {
        height: 20,
        width: "50%",
        backgroundColor: "#e0e0de",
        borderRadius: 50,
        margin: 50,
    };

    const fillerStyles = {
        height: "100%",
        width: `${completed}%`,
        backgroundColor: bgcolor,
        borderRadius: "inherit",
        textAlign: "right",
    };

    const labelStyles = {
        padding: 5,
        color: "white",
        fontWeight: "bold",
    };
    return (
        <div>
            <div className="setting_up">
                <div className="create_site">
                    <img src={deski_blue} alt="" className="create_site_logo" height="32" width="120" />
                </div>
                <h1>One moment your, site is starting up</h1>

                <img src={business_team} alt="" height="280" width="480" />
            </div>
            <div className="create_site">
                <div style={containerStyles}>
                    <div style={fillerStyles}>
                        <span style={labelStyles}>{`${completed}%`}</span>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Setting_up;
